def inputEdge():
	tiles = {}
	img = {}
	for i in range(9):
		temp = []
		m = re.match("Tile (\d*):",input())
		id = m.group(1)
		up = []
		down = []
		right = []
		left = []
		arr = []
		up = ''.join(input())
		arr.append(up)
		left.append(up[0])
		right.append(up[-1])
		for j in range(8):
			temp = input()
			arr.append(temp)
			left.append(temp[0])
			right.append(temp[-1])
		down = ''.join(input())
		arr.append(down)
		left.append(down[0])
		right.append(down[-1])
		left = ''.join(left)
		right = ''.join(right)
		tiles[id] = [left,right,up,down]
		input()
		img[id] = (arr)
	print(tiles)
	print(img)
	
